// JSON-Eingabe: Die Struktur entspricht der übergebenen Beispielstruktur
const data = $json;

// Extrahiere die Telefonnummer aus payer[phone]
let phone = data.body["payer[phone]"];

// Liste aller Ländervorwahlen
const countryCodes = ["1", "30", "31", "32", "33", "34", "36", "39", "40", "41", "43", "44", "45", "46", "47", "48", "49", "52", "62", "971", "420", "423", "27"];

// Funktion zur Bereinigung der Telefonnummer
function cleanPhoneNumber(phone) {
    // Entferne Leerzeichen, Bindestriche, Klammern und sonstige Sonderzeichen
    phone = phone.replace(/[\s()-]/g, "");

    // Entferne führende Nullen (vor dem Ländercode)
    while (phone.startsWith("0")) {
        phone = phone.substring(1);
    }

    // Wenn keine "+" vorhanden ist, füge sie hinzu (E.164 Format benötigt das "+" Zeichen)
    if (!phone.startsWith("+")) {
        phone = "+" + phone;
    }

    // Prüfe auf doppelte Ländervorwahl
    phone = removeDuplicateCountryCode(phone, countryCodes);

    // Ländervorwahl validieren und überprüfen, ob nach der Ländervorwahl keine Null steht
    for (let code of countryCodes) {
        const pattern = new RegExp(`^(\\+${code})(0+)`); // Überprüfe auf eine oder mehrere Nullen nach dem Ländercode
        if (pattern.test(phone)) {
            // Entferne alle führenden Nullen nach der Ländervorwahl
            phone = phone.replace(pattern, `+$1`); // Ersetze die Nullen durch nichts
        }
    }

    // Entferne alle doppelten '+' Zeichen und lasse nur eines übrig
    phone = phone.replace(/^\+{2,}/, "+");

    return phone;
}

// Funktion zur Überprüfung auf doppelte Ländervorwahl
function removeDuplicateCountryCode(phone, countryCodes) {
    for (let code of countryCodes) {
        const doubleCodePattern = new RegExp(`^\\+${code}{2}`);
        if (doubleCodePattern.test(phone)) {
            // Entferne die doppelte Ländervorwahl
            phone = phone.replace(`+${code}${code}`, `+${code}`);
        }
    }
    return phone;
}

// Telefonnummer bereinigen und formatieren
const formattedPhone = cleanPhoneNumber(phone);

// Berechnung der Anzahl der Zeichen inklusive des Plus-Zeichens
const phoneLength = formattedPhone.length;

// Ausgabe: Bereinigte Telefonnummer im E.164-Format und die Anzahl der Zeichen
return {
    "Phone": formattedPhone,
    "PhoneLength": phoneLength
};
